/*Table structure for table `fp_invites` */

CREATE TABLE `fp_invites` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inviter_id` int(11) NOT NULL,
  `invitee_email` varchar(100) NOT NULL,
  `invitee_id` varchar(50) DEFAULT NULL,
  `invitee_joining_date` datetime DEFAULT NULL,
  `unique_code` varchar(50) DEFAULT NULL,
  `message` text,
  `status` varchar(1) NOT NULL DEFAULT '0' COMMENT '0->unclicked, 1->clicked',
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

