/*Table structure for table `fp_memberships` */

CREATE TABLE `fp_memberships` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `alias_name` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `pricing_month` varchar(255) DEFAULT NULL,
  `pricing_year` varchar(255) DEFAULT NULL,
