/*Table structure for table `fp_payments` */

CREATE TABLE `fp_payments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `business_id` int(11) NOT NULL,
  `membership_id` int(11) NOT NULL,
  `currency` varchar(50) DEFAULT NULL,
  `total_amount` float(10,2) NOT NULL,
  `equivalent_USD` float(10,2) DEFAULT NULL,
  `card_type` varchar(100) DEFAULT NULL,
  `card_number` varchar(100) DEFAULT NULL,
  `exp_month` varchar(100) DEFAULT NULL,
  `exp_year` varchar(100) DEFAULT NULL,
  `currency_id` varchar(10) DEFAULT NULL,
  `payment_date_time` varchar(100) DEFAULT NULL,
  `payment_status` varchar(100) DEFAULT NULL,
  `transaction_id` varchar(100) DEFAULT NULL,
  `correlation_id` varchar(100) DEFAULT NULL,
  `failure_reason` varchar(255) DEFAULT NULL,
  `ip_address` varchar(100) NOT NULL,
  `payment_option` varchar(255) NOT NULL DEFAULT 'Credit Card',
  `payment_type` varchar(255) NOT NULL DEFAULT 'Claim' COMMENT 'Claim/Upgrade',
  `profile_id` varchar(255) NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

